graphql.query:
query myQuery($getProductsInput: GetProductsInput!) {
  getProducts(GetProductsInput: $getProductsInput) {
    id
    categories {
        id
        name
    }
    name
    description
    variations {
        id
      title
      price
      stock
    }
  }
}

query GetProductById($getProductByIdId: String!) {
  getProductById(id: $getProductByIdId) {
    id
    is_published
    is_deleted
    name
    description
    categories {
        id
        name
    }
    variations {
      id
      title
      price
      stock
      images {
        id
        url
        created_at
        product_variation_id
      }
    }
    created_by
    created_at
    last_updated_by
    last_updated_at
  }
}

