mutation AddToCart($variationId: String!, $quantity: Int!) {
  addToCart(variation_id: $variationId, quantity: $quantity)
}

query GetCartItems {
  getCartItems {
    id
    cart_owner {
      email
    }
    product_variation {
      title
      id
      price
      stock
      images {
        url
      }
    }
    quantity
  }
}

query GetOrders {
  getOrders {
    id
    user {
      id
      first_name
      last_name
      email
    }
    paymentStatus
    order_items {
      id
      quantity
      price_purchased_at
      product_variation {
        title
        stock
      }
    }
  }
}

